import React from 'react';
import ReactDOM from 'react-dom';

function ProfileCard(name, age, favIceCreamFlavor) {
    return (
        <div className="prof-card">
            <img src="" alt=""/>
        </div>
    )
}

ReactDOM.render(
    <ProfileCard />

    , document.getElementById("root"));
